import Vue from 'vue'
import Router from 'vue-router'
//引入自定义组件
import IndexContainer from "./components/index.vue"
import HeaderContainer from "./components/sub/header.vue"
Vue.use(Router)
//配置访问自定义组件路径
export default new Router({
  routes: [


    {path:'/index',component:IndexContainer},
    {path:'/header',component:HeaderContainer}


  ] 
})
